```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <sstream>

int countWordOccurrences(const std::string& filename, const std::string& word) {
    std::ifstream file(filename);
    if (!file.is_open()) {
        std::cerr << "Could not open file: " << filename << std::endl;
        return -1;
    }

    int count = 0;
    std::string line;
    while (std::getline(file, line)) {
        std::istringstream iss(line);
        std::string token;
        while (iss >> token) {
            // Convert token to lower case for case-insensitive comparison
            std::transform(token.begin(), token.end(), token.begin(), ::tolower);
            std::string lowerCaseWord = word;
            std::transform(lowerCaseWord.begin(), lowerCaseWord.end(), lowerCaseWord.begin(), ::tolower);

            if (token == lowerCaseWord) {
                count++;
            }
        }
    }

    file.close();
    return count;
}

int main() {
    std::string filename;
    std::cout << "Enter the name of the file: ";
    std::cin >> filename;

    std::string word;
    std::cout << "Enter the word to count: ";
    std::cin >> word;

    int occurrences = countWordOccurrences(filename, word);
    if (occurrences != -1) {
        std::cout << "The word '" << word << "' occurs " << occurrences << " times in the file." << std::endl;
    }

    return 0;
}
